script: |
  super -f text -I q1249.spq | sort > q1249.out

inputs:
  - name: q1249.spq
    data: |
      SELECT DISTINCT - - col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 IN ( ( - CAST ( + col1 AS REAL ) ) / + col0, - 63 + + col1 );
  - name: tab0

outputs:
  - name: q1249.out
    data: |
      15
      87
      97
